import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notes from '../notes';

const getContent = temp => {
return (
		<Note
		key={temp.key}
		title={temp.title}
		content={temp.content}
		/>
	);
}

function App(){
	return (
	<div>
		<Header /> 
		{notes.map(getContent)}
		<Footer />
	</div>
	);
}

export default App;
